import "semantic-ui-css/semantic.min.css";
import AdvocateDBoard from "./dashboards/AdvocateDBoard";
import DBoardTemplate from "./dashboards/DBoardTemplate";
import A2JDBoard from "./dashboards/DBoardTemplate";
import LoginPage from "./login/LoginPage";
import LoginButton from "./login/components/LoginButton";
import AdvocateAuth0ProviderWithHistory from "./auth0-provider-with-history-advocate";
import { Auth0Provider } from "@auth0/auth0-react";

const domain = process.env.ADVOCATE_REACT_APP_AUTH0_DOMAIN;
const clientId = process.env.ADVOCATE_REACT_APP_AUTH0_CLIENT_ID;

function App() {
  return (
    <div className="App">
      <AdvocateDBoard />
      <DBoardTemplate />

      <Auth0Provider
        domain={domain}
        clientId={clientId}
        redirectUri={window.location.origin}
      >
        <LoginButton />
      </Auth0Provider>

      <A2JDBoard />
      <LoginPage />
    </div>
  );
}

export default App;
